B.vb=new A.aB("The efficacy of cardiac resynchronization therapy (CRT) has been widely studied in the medical literature; however, about 30% of candidates fail to respond to this treatment strategy. Smart computational approaches based on clinical data can help expose hidden patterns useful for identifying CRT responders. We retrospectively analyzed the electronic health records of 1664 patients who underwent CRT procedures from January 1, 2002 to December 31, 2017. An ensemble of ensemble (EoE) machine learning (ML) system composed of a supervised and an unsupervised ML layers was developed to generate a prediction model for CRT response. Using the most comprehensive set of predictors, the performance of the EoE model in terms of the area under the receiver operating characteristic curve and F1-score were 0.76 and 0.73, respectively. Direct application of the CNN model on the raw ECG waveforms did not generate promising results. ",null,null,B.j,null)
B.vc=new A.aB(", and other programs at Pitt.\n\n",null,null,B.j,null)
B.vd=new A.aB("at the ",null,null,B.j,null)
B.ve=new A.aB("PhD",null,null,B.j,B.as)
B.vg=new A.aB(", has a simple goal: to make healthcare better through the power of explainable artificial intelligence (AI). Our research focuses on engineering, implementing, validating, and deploying cutting-edge fundamental and applied AI algorithms, and promote their applications in healthcare problems. We attempt to answer three main questions: 1) how advanced explainable AI strategies are developing in healthcare, 2) how they shape healthcare systems, and 3) how they impact the healthcare community.",null,null,B.j,null)
B.vf=new A.aB("From the computational perspective, deep learning computer vision methods have already demonstrated very successful applications in a variety of medical image analysis tasks. However, there are several fundamental challenges that stop deep learning methods to obtain their full potential in healthcare settings. One can see that they often need a large column of annotated training data to achieve better accuracy over traditional machine learning methods. The current work tends to use deep few-shot learning to tackle the problem of knee joint space segmentation in plain radiographs using only few samples of manually segmented radiographs.",null,null,B.j,null)
